import React from "react";
import "./Header.css";

const Header = () => {
  return (
    <header className="header">
      <img src="%PUBLIC_URL%/favicon.ico"></img>
      <h1 className="title">Pathfinding Visualizer</h1>
    </header>
  );
};

export default Header;
